import React from "react";

const About = () => {
  return (
    <section id="about">
      <h2>About Us</h2>
      <p>
        HelpingHand NGO focuses on education, health, and well-being for children in need.
        We work with volunteers, donors, and community partners to make a real impact.
      </p>
    </section>
  );
};

export default About;
